  \"The status of the peregrine falcon (Falco peregrines) in northeastern Alaska:
  East fork Chandalar River drainage east to the Canadian Border, Arctic Ocean south
  to the Porcupine and Chandalar Rivers (including the Arctic National Wildlife Range)
  and the S\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:19.807356\",\n\t\"name\":
  \"the-status-of-the-peregrine-falcon-falco-peregrines-in-northeastern-alaska-east-fork-chand\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Prior to 1972, little was known about the
  Peregrine Falcon (Falco peregrinus) populations that breed in northeastern Alaska.
  The following is a report of peregrine surveys made in northeastern Alaska between
  1972 and 1975. The regions we surveyed can be generally described as: The Sagavanirktok
  River drainage, the Arctic Slope between the Sagavanirktok River and the Canadian
  border, the eastern Brooks Range and the Yukon Flats-Porcupine Plateau region north
  of the Porcupine and Chandalar rivers. This region covers some 91,000 square kilometers
  of Alaska. Aerial and/or ground survey techniques were employed in searching for
  peregrine aeries in this vast region.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
